// src/App.tsx
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomeDesktop from "./pages/HomeDesktop";

const Dummy = ({ name }: { name: string }) => (
  <div style={{ padding: "2rem", fontSize: "2rem" }}>{name} page</div>
);

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomeDesktop />} />
        <Route path="/menu" element={<Dummy name="Menu" />} />
        <Route path="/delivery" element={<Dummy name="Delivery" />} />
        <Route path="/pickup" element={<Dummy name="Pickup" />} />
        <Route path="/about" element={<Dummy name="About Us" />} />
      </Routes>
    </Router>
  );
}

export default App;
